node.text:
In un calda giornata di fine settembre, il sole splendeva su Piazza Gae Aulenti a Milano. Io indossavo strenuamente dei sandali, perchè sono fatta così: io mi vesto estiva fino  quando non decido che per me è finita l'estate, anche quando il sole si gira e se ne va. E il sole non era stato l'unico a voltarmi le spalle in quel periodo, perchè io a dispetto dei grandi sorrisi so celare molto bene l'inverno, soprattutto quando è dentro di me. E cazzo, se faceva freddo. Ad accorgersene è stato Stefano Sgambati per the creative brothers che è riuscito a cogliere tanti miei aspetti che credevo di avergli nascosto. Insomma Stefano t'ho fregato, ma non così tanto. Il risultato è un intervista vera, bellissima e divertente che vi consiglio di leggere e che unita alle foto di sara sabatino e al trucco di alis rose glm è una vera bomba. Trovate il link nelle stories

